const ComA: React.FC<{count: number, onclick: () => void}> = () => {
    return <div>
        this is comA
    </div>
}
const ComB: React.FC<{count: number, onclik: () => void}> = () => {
    return <div>
        this is comB
    </div>
}
const Test: React.FC = () => {
    const [countA, setCountA] = useState(0)
    const [countB, setCountB] = useState(1)
    clickA = () => {
        setCountA(s => s + 1)
    }
    return (
        <div>
            <h1>this is test page</h1>
            <hr/>
            <ComA count={countA} onclick={clickA} />
            <hr />
            <ComB count={countB} />
        </div>
    )
}
export default Test;
